class ProjectAddMemberRequestModel {  int? manageProjectId;  List<int?>? staffId;  int? manageProjectRoleId;  ProjectAddMemberRequestModel(      {this.manageProjectId, this.staffId, this.manageProjectRoleId});  ProjectAddMemberRequestModel.fromJson(Map<String, dynamic> json) {    manageProjectId = json['manage_project_id'];    staffId = json['staff_id'].cast<int>();    manageProjectRoleId = json['manage_project_role_id'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['manage_project_id'] = this.manageProjectId;    data['staff_id'] = this.staffId;    data['manage_project_role_id'] = this.manageProjectRoleId;    return data;  }}